import React, {useState, useEffect} from "react";
import styled from "styled-components";
import axios from "axios";
import AppBar from "./AppBar";
import ChooseButton from "./ChooseButtons";

const AppHome = () => {
    return (
        <div>
            <div>
               <AppBar/> 
            </div>
        
            <div>
                Sou seu Home!
            </div>
            <hr/>
            <div>
                <ChooseButton/>
            </div>
        </div>
    )
}

export default AppHome;
